import React from 'react';

class SignUp extends React.Component{
  render(){
    return(
      <div className="form">
        <h1>Sign Up</h1>
        <form>
          <input type='text' name="username"/>
            <br/>
            <br/>
          <input type='password' name="password"/>
            <br/>
            <br/>
          <input type="submit" value="Submit" />
        </form>
      </div>
    )
  }
}

export default SignUp
